import React from 'react';
//import data
import {copyright} from "../data";

const Copyright = () => {
  //copyright data
  const {link1, link2, copyText, social} = copyright;
  return <div>
    {/*  links */}
    <div>links</div>
    {/*  copyright text */}
    <div>{copyText}</div>
    {/*  social icons */}
    <ul>
      {social.map((item, index)=>{
        return <li key={index}></li>
      })}
    </ul>
  </div>;
};

export default Copyright;
